    "description2": "15. juni til 15. august. Det er heller ikke lov til å bolte mer i overhenget.  Profilveggen byr på bratt og tung teknisk klatring, henger ut ca 18m på 50 høydemeter. 13 ruter",
    "leisure": "pitch",
