    "description2": "Tips: De 2 første rappellene er overhengende, la ikke tauet blåse rundt kanten, det setter seg fast ! Husk at knuten på enden av tauet må være veldig stor. Prussikknuten må være under åtteren. Ref. dødsulykke i mai 1999.",
